import{_ as e,o as i,c as a,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 46.2-862 Exceeding speed limit.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-862.md","filePath":"vacode/46.2-862.md"}'),r={name:"vacode/46.2-862.md"},c=t('<h1 id="§-46-2-862-exceeding-speed-limit" tabindex="-1">§ 46.2-862 Exceeding speed limit. <a class="header-anchor" href="#§-46-2-862-exceeding-speed-limit" aria-label="Permalink to &quot;§ 46.2-862 Exceeding speed limit.&quot;">​</a></h1><p>A person is guilty of reckless driving who drives a motor vehicle on the highways in the Commonwealth (i) at a speed of 20 miles per hour or more in excess of the applicable maximum speed limit or (ii) in excess of 85 miles per hour regardless of the applicable maximum speed limit.</p><p>Code 1950, §§ 46-209, 46-209.1; 1950, p. 880; 1952, c. 671; 1954, cc. 225, 401, 458; 1958, c. 541, § 46.1-190; 1960, c. 510; 1964, c. 266; 1966, c. 694; 1968, c. 575; 1970, c. 521; 1974, cc. 222, 455; 1975, c. 633; 1978, c. 27; 1979, c. 86; 1981, cc. 333, 585; 1985, c. 148; 1989, c. 727; 1992, c. 608; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0301" target="_blank" rel="noreferrer">301</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0444" target="_blank" rel="noreferrer">444</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0445" target="_blank" rel="noreferrer">445</a>.</p>',3),o=[c];function s(l,n,p,d,_,m){return i(),a("div",null,o)}const f=e(r,[["render",s]]);export{g as __pageData,f as default};
